export class Zapatilla {
  
    nombre:string;
    precio:number;
    marca:string;
    color:string;
    stock:boolean;

    constructor(nombre, precio, marca, color, stock){
        this.nombre = nombre;
        this.precio = precio;
        this.marca = marca;
        this.color = color;
        
    }
    
     /*
    constructor(
        { nombre, precio, marca, color, stock }: { nombre: string; precio: number; marca: string; color: string; stock: boolean; }) { }
        */
}
